	//Создаем 1-ю картограмму
	const indicator1 = L.choropleth(boundary, {
		valueProperty: 'Водопровод', // указываем название столбца из вашего GeoJSON
		scale: ['#E6E6FA', '#FF00FF'], // указываем цвета для градиента картограммы
		steps: 5, // указываем количество ступеней картограммы
		mode: 'e', // выбираем алгоритм классификации данных: q для квантилей, e для равных интервалов, k для метода k-средних
		style: {
			color: '#C0C0C0', // цвет обводки
			weight: 0.3, //толщина обводки
			fillOpacity: 0.4 //прозрачность фоновой окраски
		},
		onEachFeature: function(feature, layer) { //Создаем всплывающее окно со значением показателя для каждого субъекта
		layer.bindPopup(String(feature.properties.total_growth))
		}
	})

	//Создаем 2-ю картограмму
	const indicator2 = L.choropleth(boundary, {
		valueProperty: 'Канализация', 
		scale: ['#FFF8DC', '#C71585'],
		steps: 5,
		mode: 'e',
		style: {
			color: '#C0C0C0',
			weight: 0.3,
			fillOpacity: 0.4
		},
		onEachFeature: function(feature, layer) {
		layer.bindPopup(String(feature.properties.number_births))
		}
	})

	//Создаем 3-ю картограмму
	const indicator3 = L.choropleth(boundary, {
		valueProperty: 'Отопление',
		scale: ['#98FB98', '#2E8B57'],
		steps: 5,
		mode: 'q',
		style: {
			color: '#C0C0C0',
			weight: 0.3,
			fillOpacity: 0.4
		},
		onEachFeature: function(feature, layer) {
		layer.bindPopup(String(feature.properties.number_deaths))
		}
	})

	//Включаем по умолчанию отображение 1-й картограммы
	indicator1.addTo(map);


	//Создание легенды
	const legend = L.control({ position: 'bottomright' });

	// Включаем по умолчанию отображение легенды для 1-й картограммы
	legend.onAdd = function (map) {
  		const div = L.DomUtil.create('div', 'info legend');
  		updateLegendContent(indicator1.options.limits, indicator1.options.colors, div);
  		return div;
	};

	function updateLegendContent(limits, colors, container) {
  		container.innerHTML =
    		`<div class="labels"><div class="min">${limits[0]}</div>` +
    		`<div class="max">${limits[limits.length - 1]}</div></div>`;

  		let labels = [];
  		limits.forEach(function(limit, index) {
   		 labels.push('<li style="background-color: ' + colors[index] + '"></li>');
  		});
  	container.innerHTML += '<ul>' + labels.join('') + '</ul>';
	}
	
	legend.addTo(map);

	//Настраиваем изменение легенды при переключении картограмм
	map.on('overlayadd', function(e) {
  		const layer = e.layer;
  		if (layer === indicator1) {
    		updateLegendContent(indicator1.options.limits, indicator1.options.colors, legend.getContainer());
  		} else if (layer === indicator2) {
    		updateLegendContent(indicator2.options.limits, indicator2.options.colors, legend.getContainer());
  		} else if (layer === indicator3) {
    		updateLegendContent(indicator3.options.limits, indicator3.options.colors, legend.getContainer());
  		}
	});

